import React from "react"
import X from "../images/1.png"
import O from "../images/0.png"

 const BoardElemt = (props)=>
 {
     if(props.el === 1){
        return (            
            <div className="playItem" onClick={props.handelClick}><img className="icon" src={X} alt="O"/></div>
        )
     }else if(props.el === 0){
        return (            
            <div className="playItem" onClick={props.handelClick}><img className="icon" src={O} alt="O"/></div>
        )
     }else {
        return (            
            <div className="playItem" onClick={props.handelClick}></div>
        )
     }
        
 }
 
 export default BoardElemt
